      <div className="jumbotron resultsContainer">
        <p className="lead resultsHeader">Results</p>
        {result.length ? (
          <>
            {result.items.map((book) => (
              <Card
                key={book.id}
                title={book.volumeInfo.title}
                author={book.authors}
              />
            ))}
          </>
        ) : (
          <h3>No Results to Display</h3>
        )}
      </div>
    </div>
  );
}

